import { Button, ConfigProvider } from 'antd';
import React from 'react';

const App = () => (
  <ConfigProvider
    theme={{
      token: {
        colorPrimary: '#1DA57A',
        margin: 0,
        padding: 0,
      },
    }}
  >
    <Button type="primary">Button</Button>
    <Button type="primary">Button</Button>
  </ConfigProvider>
);

export default App;
